import React from "react";
import Icon from "@mdi/react";
import { mdiCalendar } from "@mdi/js";

export function Date() {
  return (
    <div className="form-group row">
      <label className="col-sm-2 col-form-label">Purchase Date</label>
      <div className="col-sm-10">
        <div className="input-group-prepend">
          <span className="input-group-text input-group-text-custom">
            <Icon path={mdiCalendar} size={0.5} className="myIcon">
              ::before
            </Icon>
          </span>
          <input
            type="text"
            className="form-control border border-top-0 border-right-0"
            id="datepicker-autoclose"
            placeholder="dd/mm/yyyy"
          />
        </div>
      </div>
    </div>
  );
}
